import React, { Component } from "react";
import './App.css';

function handleClickOi() {
  console.log('Oi');
  return('Oi');
}

function handleClickSou() {
  console.log('Sou');
  return('Sou');
}

const tentar = [handleClickOi, handleClickSou]


class App extends Component {
  render() {
  return <div>
    {tentar.map((item) => <button key = {item} onClick={item}>{item()}</button>)}
  </div>
  }
}

export default App;
